import React from "react";
import { useState } from "react";

const Apply = () => {
    const [name, setName] = useState("");

    return (
        <div className="Apply-div">
            <form>
      <label>Enter your name:
        <input
          type="text" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
    </form>
   
        </div>
    )
}
export default Apply
